import React from 'react';
import { Link, NavLink } from 'react-router-dom';

const Nav = props => {
    /**
     * TODO:
     * For each div below, decide if it should navigate the user to a specific page
     * Then, use the tools from React Router so when the user clicks on the text, it navigates them to that path
     */
    conditionalButton=()=>{return(this.props.currentUser !== {} ? <Link to="/login"><div>Logout</div></Link>: <Link to="/login"><div>Login</div></Link>)}

    return (
        <div className="simple-flex-row">
            <Link to="/"><div>Home</div></Link>
            <Link to="/user"> <div>Profile</div> </Link>
            <div className="simple-flex-row right-corner">
                <Link to="/beaches"><div>Beaches</div></Link>
                <Link to="/reviews"><div>My Reviews</div></Link>
                {this.conditionalButton}
            </div>
        </div>
    )
}

export default Nav;
